window.bookSummaryJSON = "<p><b>Welcome to the thrilling, sexy, laugh out loud funny world of New York Times best-selling author Katie MacAlister's Dark Ones, where the vampires are smokin' hot. </b></p> <p><i>Tempest Keye's life is just beginning. <br></i>Growing up in a religious cult, Tempest could only dream of the world outside. Once free, Tempest is determined to live her life to the fullest, and to check off each item on her bucket list. First on her agenda - to meet an honest-to-goodness vampire. It's just a shame the one she finds doesn't understand how the whole Dark Ones thing is supposed to work. Luckily for him, she's patient. </p> <p><i>Merrick Simon's life is coming to an end. <br></i>One of the legendary Four Horsemen, Merrick has saved many mortals and immortals alike from peril. Facing the most dangerous mission of his life, Merrick is forced to rely on a sexy, maddening woman who insists she's his Beloved. Like he has time for that. </p> <p><i>Both need more time.... <br></i>The closer they come to finding the truth, the more dangers lurk in the shadows. Worse, Merrick finds himself falling for Tempest's quirky take on life. Together, they fight for the one thing that matters most - their happily ever after. </p> <p>Fans of Lynsay Sands' Argeneau vampire family will love to sink their teeth into Katie MacAlister's funny yet sensual vampire world. See for yourself why <i>Booklist</i> proclaimed Katie MacAlister's Dark Ones to be, \"Wickedly sexy and wildly humorous...[a] wonderfully original, practically perfect paranormal treat.\" </p>"; 
